-- ----------------------------
-- View structure for view_alarm_record_day
-- ----------------------------
DROP VIEW IF EXISTS `view_alarm_record_day`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`%` SQL SECURITY DEFINER VIEW `view_alarm_record_day` AS select `a`.`cal_date` AS `alarm_date`,`b`.`id` AS `id`,`b`.`device_id` AS `device_id`,`b`.`group_code` AS `group_code`,`b`.`module` AS `module`,`b`.`com` AS `com`,`b`.`channel` AS `channel`,`b`.`alarm_event` AS `alarm_event`,`b`.`alarm_time` AS `alarm_time`,`b`.`alarm_type` AS `alarm_type`,`b`.`recovery_time` AS `recovery_time`,`b`.`recovery_type` AS `recovery_type`,timestampdiff(SECOND,if((`a`.`start_time` > `b`.`alarm_time`),`a`.`start_time`,`b`.`alarm_time`),if((`a`.`end_time` > `b`.`modify_time`),`b`.`modify_time`,`a`.`end_time`)) AS `duration` from (`sys_date` `a` left join `alm_alarm_record` `b` on(((`a`.`start_time` >= date_format(`b`.`alarm_time`,'%Y-%m-%d')) and ((`a`.`cal_date` <= date_format(`b`.`recovery_time`,'%Y-%m-%d')) or isnull(`b`.`recovery_time`)) and (`b`.`modify_time` > `a`.`start_time`))));

SET FOREIGN_KEY_CHECKS = 1;
